import "./ExpensesList.css"
import ExpenseItem from "./ExpenseItem";

const ExpensesList = props => {
    let expneseContent = <p className='paraE'>No expense Found</p>;

	if (props.items.length > 0) {
		expneseContent = props.items.map((expee) => (
				<ExpenseItem
					key={expee.id}
					title={expee.title}
					amount={expee.amount}
					date={expee.date}
				/>
			))
	}

    return  <ul className="expenses-list">

    </ul>

};


export default ExpensesList
